import React from 'react';
import rockstar from "./image/rockstar.png";
import "./Register.css";


const Register = () => {
  return (
    <div className='register-page'>
        <div className="left_container">
            <img src={rockstar} alt="" />
        </div>
        <div className="right_container">
            <h1>Super App</h1>
            <p>Create </p>
        </div>
      
    </div>
  )
}

export default Register
